import React from 'react';
import '../App.css'

function Footer() {
  return (
		<footer className='Main_Footer'>
			<p>- 프로젝트 과정으로 제작된 홈페이지임을 참고 바랍니다. -</p>
			<p/>
			<p>이 Steam 라이브러리는 VALVE와 관련이 없고, VALVE의 지원을 받고 있지 않습니다.</p>
      <p>Copyright © 2024.11.04 ~ 2024.11.11 By 대체로 긍정적(4) All Rights Reserved.</p>
    </footer>
  );
}

export default Footer;
